/* eslint-disable no-duplicate-case */
/* eslint-disable no-fallthrough */
import React from 'react';
import TextField from '@material-ui/core/TextField';
import { bigIntLiteral } from '@babel/types';


const Input = (props) => {
  const { input } = props;

  let dynamicInputField = null 

  switch (input.type) {

    case('text'):
      dynamicInputField = <TextField 
                                id={input.id}
                                label={input.label}
                                required={input.required}
                                style={input.style}
                                name={input.name}
                                type={input.name}
                                onChange={input.handleInputChange}
                          />
      break;

    case('email'):
        dynamicInputField = <TextField 
                              id={input.id}
                              label={input.label}
                              required={input.required}
                              style={input.style}
                              name={input.name}
                              type={input.name}
                              onChange={input.handleInputChange}
                            />
        break;                   

    case('password'):
        dynamicInputField = <TextField 
                              id={input.id}
                              label={input.label}
                              required={input.required}
                              style={input.style}
                              name={input.name}
                              type={input.name}
                              onChange={input.handleInputChange}
                            />
        break; 
    case('select'):


        dynamicInputField = <TextField
                      id={input.id}
                      select={input.select}
                      label={input.label}
                      style={input.style}
                      name={input.name}
                      onChange={input.handleInputChange}

